import {Link} from 'react-router-dom';


const Page404 = () => {
    return (
        <div style={{}}>
            <ErrorMessage/>
            <p style={{textAlign: 'center', fontWeight: 'bold', fontSize: '24px'}}> This page not found </p>
            <button>
                <Link style={{display: 'block', border: '1px solid black', width: '100px', textAlign: 'center', fontWeight: 'bold', fontSize: '24px', marginTop: '30px'}} to="/">Back to main page</Link>
            </button>
        </div>
    )
}

